        // }

        //log result of update
        emit LogMatchResultUpdate("match update success");

        return true;
    }

    /// creates a match if a new match is received from oracle/opta api callback
    function createMatchAndWager(
        bytes20 wagerId,
        string memory response
    )
        internal
        onlyCLevelOrOracle
        whenNotPaused
        returns (bool)
